BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "products" (
	"id"	INTEGER NOT NULL UNIQUE,
	"name"	TEXT,
	"price"	INTEGER,
	"des"	TEXT,
	"image"	BLOB,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "users" (
	"id"	INTEGER,
	"name"	TEXT,
	"email"	TEXT,
	"password"	TEXT,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "cart" (
	"name"	TEXT,
	"id"	INTEGER,
	"price"	TEXT,
	"image"	BLOB,
	"qty"	INTEGER,
	"product"	INTEGER
);
